    false,nt"url": null,nt"notes": "This report provides a detailed summary
    of the baseline wilderness character assessment completed for the Dale Bumpers White
    River Wilderness on the Dale Bumpers White River National Wildlife Refuge.  The
    purpose of this report is multi-dimensional. It establishes a wilderness character
    monitoring program for the Dale Bumpers White River Wilderness and provides baseline
    data for future trend analysis. An understanding of the information in this report
    may also aid resource specialists by informing management decisions within the Dale
    Bumpers White River Wilderness. Finally, this report is meant to accompany and explain
    the quantitative results of Dale Bumpers White River's wilderness character assessment
    that have been entered into a national wilderness character monitoring database.
     A total of 25 measures were used to assess the following: untrammeled quality,
    natural quality, undeveloped quality, and solitude or primitive and unconfined recreation
